import React from "react";
import "./Home.scss";
import Stories from "../../components/stories/Stories";
import Posts from "../../components/posts/Posts";
const Home = () => {
  return (
    <div>
      <Stories />
      <Posts />
    </div>
  );
};

export default Home;
